import React from 'react';
import {
  ImLinkedin,
  ImGithub,
} from 'react-icons/im';

const Socials = () => {
  return (
    <div className='hidden xl:flex ml-24'>
      <ul className='flex space-x-4'>
        <li>
          <a href="https://www.facebook.com/">
            <ImLinkedin />
          </a>
        </li>
        <li>
          <a href="#">
            <ImGithub />
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Socials;
